window.bookSummaryJSON = "<p>Ripped from my mates. Taken by an evil who has it out for us all. And it’s all I can do to hold on, just hoping that they will find me before it’s too late. Because I’m in the clutches of someone who only wants one thing…power. Power that only I can give them. And I’m a second away from breaking.</p> <p>But my captor is revealing secrets. Ones that have the potential to bring my world crumbling down. And not just mine but the entire dragon species’, too. Now, we’re racing against the clock to keep those secrets buried and me safe. But our enemies are circling. And sometimes the deadliest are the ones you least expect…</p>"; 
